INSERT INTO `gd_article` VALUES ('280', '101', '长塑简介', '长塑简介', '', '{\"content\":\"<p>长塑简介<br/></p>\"}', null, '长塑简介', '0', '0', '20150413111212', '0'), ('281', '221', '长塑简介', '长塑简介', '', '{\"content\":\"<p>长塑简介</p>\"}', null, '长塑简介', '14', '0', '20150413120540', '0'), ('282', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152128', '0'), ('283', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152134', '0'), ('284', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152140', '0'), ('285', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152140', '0'), ('286', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152140', '0'), ('287', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152140', '0'), ('288', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152140', '0'), ('289', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152140', '0'), ('290', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152141', '0'), ('291', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152141', '0'), ('292', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152145', '0'), ('293', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152145', '0'), ('294', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152146', '0'), ('295', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152146', '0'), ('296', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152146', '0'), ('297', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152146', '0'), ('298', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152146', '0'), ('299', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152147', '0'), ('300', '222', '', '', '/wxadmin/upload/article/150413151944EIHLOZB.plain', '{\"content\":\"\"}', null, '', '0', '0', '20150413152154', '0'), ('302', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"<p>厦门长塑实业有限公司是一家集绿色生活材料研发、制造与营销为一体的科技型企业，是全球最大的BOPA双向拉伸尼龙薄膜生产商，中国领先的绿色生活材料提供商。公司秉承着长久呵护你我健康家园，倾力塑造人类绿色空间的企业使命，立足绿色生活材料领域，整合全球先进资源与技术，不断创新与发展，致力于实现成为世界级绿色生活材料的引领者的企业愿景。</p><p>公司拥有按国家级工程技术研究中心标准建设的高分子新材料实验室，并已建成一支高素质、专业化的研发团队，同时还聘请国外产业技术综合研究所首席研究官作为公司技术顾问。公司长期开展深度“产学研”合作，已与杭州师范大学合作设立“长塑新材料研发中心”，并与中国科学院、厦门大学、知名高分子材料研究机构及业内一流企业达成战略合作。自创立以来，长塑始终立足科技创新，自主研发的生产工艺和产品配方现已取得多项国家发明专利。&nbsp;</p><p><br/></p>\"}', null, '', '0', '0', '20150413152449', '0'), ('303', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152454', '0'), ('390', '237', '持恒健身，拥抱变革—“活力长塑”第一届职工运动会圆满举办', '', '/wxadmin/upload/article/150414151207YREBKPB.jpeg', '{\"content\":\"<p><span style=\\\";padding: 0px;color: rgb(102, 102, 102);font-size: 12px;line-height: 24px;text-indent: 28px;background-color: rgb(255, 255, 255);font-family: 宋体\\\">2014</span><span style=\\\";padding: 0px;color: rgb(102, 102, 102);font-size: 12px;line-height: 24px;text-indent: 28px;background-color: rgb(255, 255, 255);font-family: 宋体\\\">年<span style=\\\";padding: 0px\\\">4</span>月<span style=\\\";padding: 0px\\\">26</span>日，风晴日朗，天高云淡。持恒健身，拥抱变革——“活力长塑”第一届职工运动会在海沧区东孚中学圆满举办。长塑实业董事长王哲夫、副总裁牟青英等重要领导以及海沧区工会常委副主席叶通水，东孚镇党委委员、工会联合会主席罗丽萍，东孚学校办公室主任柯振嘉出席开幕式，共享体育盛会。</span></p>\"}', null, '2014年4月26日，风晴日朗，天高云淡。持恒健身，拥抱变革', '18', '0', '20150414122202', '0'), ('305', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152500', '0'), ('306', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152527', '0'), ('307', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152552', '0'), ('308', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152553', '0'), ('309', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152553', '0'), ('310', '221', '', '', '/wxadmin/upload/article/150413152446PZVDTOY.jpeg', '{\"content\":\"\"}', null, '', '0', '0', '20150413152553', '0'), ('383', '249', '担当 拼搏 创造 成长', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 担当：用百分百的敬业度，人人争当敬业乐群的长塑主人；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 拼搏：用百分百的激情度，人人争当拼搏进取的长塑拓疆者；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 创造：用百分百的智慧力，人人争当效能创造的长塑主力军；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 成长：用百分百的汲取力，人人争当基业长青的长塑捍卫者。</span></p>\"}', null, '', '6', '0', '20150414121701', '0'), ('312', '241', '技术创新，长塑腾飞的引擎', '', '/wxadmin/upload/article/150413153535YCTNEYL.jpeg', '{\"content\":\"<p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;创新是长塑在薄膜应用领域研究发展的核心竞争力。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;在产品研发、工艺技术、设备工程、自动化等领域始终追寻创新解决方案。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;实现持续的增长和行业领先。</p><p><br/></p>\"}', null, '摘要 位置', '4', '0', '20150413153601', '0'), ('313', '222', '标题', '', '/wxadmin/upload/article/150413153612BEEZESL.png', '{\"content\":\"<p>长塑是一家提供绿色生活材料的科技型企业，致力于人类生活品质的改善和提高。我们不断追求客户、股东、员工、合作伙伴、社会的和谐共生，共同发展，也关注健康安全、环境友好和资源节约，并致力于成为社会的优秀企业公民。</p>\"}', null, '', '0', '0', '20150413153645', '0'), ('314', '242', '掌握资源，成为行业引领者', '', '/wxadmin/upload/article/150413153651SXILUMY.jpeg', '{\"content\":\"<p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;长塑拥有高素质和专业化的研发团队，配备了先进的研究开发设备，自主研发多项生产工艺和产品配方并获得国家专利。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;以全球化的视野和多元化的思维与众多知名大学、科研院所及公司积极合作。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;雄厚的研发资源形成了一个庞大的合作网络，快速充实和提升了长塑的研究实力。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;紧密贴合市场需求，不断推动已有产品的突破和升级，持续投入开拓研发实力。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;着眼于前沿技术和未来产品的研发储备，引领中国和全球市场的发展方向。</p><p><br/></p>\"}', null, '空', '0', '0', '20150413153730', '0'), ('389', '230', 'BOPA薄膜产品', '', '', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp; &nbsp; &nbsp; BOPA薄膜是由已内酰胺（CPL）开环聚合得到的尼龙6（PA6）制成的，将这种原料在专用设备上经过熔融挤出流延，再进行纵向、横向拉伸制成薄膜，即双向拉伸尼龙薄膜。目前，BOPA薄膜已成为继BOPP 、BOPET 薄膜之后的拉伸薄膜家族中的第三大品种。</p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;BOPA 薄膜具有非常优异的产品性能：</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; 1、极其优异的拉伸强度、抗穿刺强度；</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 2、对常见气体（O<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub>&nbsp;、N<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub>&nbsp;、CO<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub>&nbsp;）和气味具有较好的阻隔效果；</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 3、可使用温度范围宽广（-60℃-150℃）；</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; 4、印刷性能优良；</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 5、良好的柔韧性、耐冲击、耐磨性、透明度、光泽度高；</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; 6、耐酸、碱、油脂及各种常见有机溶剂。</p><p><br/></p>\"}', null, '', '1', '0', '20150414122131', '0'), ('388', '225', '长塑TV', '', '/wxadmin/upload/article/150414152718FOEINMA.jpeg', '{\"content\":\"\"}', null, '', '9', '0', '20150414122053', '0'), ('316', '243', '质量是长塑的信誉和生命之泉', '', '/wxadmin/upload/article/150413153756XSGSQSP.jpeg', '{\"content\":\"<p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;长塑拥有先进的检测设备、优秀的质量检验团队,建立了科学完整的质量保障流程与体系，大力推行全面质量管理,为客户提供品质优良和稳定的产品。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;执行标准： GB/T20218-2006《双向拉伸聚酰胺（尼龙）薄膜》。符合国家标准GB1632《食品包装材料用尼龙成型品卫生标准》可用于食品包装。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;公司目前通过如下认证：</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1、BSI（英国标准协会）ISO9001:2008质量认证；</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2、QS认证；</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3、FDA 21 CFR 177.1500；</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4、EC 207/19/EC；</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5、REACH SVHC。</p><p><br/></p>\"}', null, '摘要', '0', '0', '20150413153822', '0'), ('387', '224', '文化图腾', '', '', '{\"content\":\"<p style=\\\"margin: 2px auto 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; line-height: 20px; white-space: normal;\\\">族徽-<span style=\\\"margin: 0px; padding: 0px; color: rgb(24, 113, 39);\\\">长青树</span></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-size: 12px; line-height: 20px; font-family: 微软雅黑;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;长青树是我们长塑的族徽，也是我们事业的图腾。树是“塑”的谐音字，也是公司“五速发展策略”和“绿色产业”的象征。</span><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\"></span></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><br/></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: 微软雅黑;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;长青树是生命的象征，也是使命的象征；是速度的象征，也是持恒的象征。</span></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: 微软雅黑;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;长塑有如长青树，具有强大的生命力、创造力和强烈的使命感，兴绿色实业，不断整合先进资源与技术，速育才、速创新、速周转、速覆盖、速扩张，持恒发展，为社会创造更多价值，以绿色产业回报社会。</span></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin: 2px auto 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; line-height: 20px; white-space: normal;\\\">族群-<span style=\\\"margin: 0px; padding: 0px; color: rgb(24, 113, 39);\\\">长青林</span></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: 微软雅黑;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;长塑以“树”为企业文化象征，立长塑之道，植长塑之林。</span></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: 微软雅黑;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;长塑之“道”，即长期耕耘管理、快速开拓运营，实现树大根深、基业长青；长塑之“林”，即汇各界英才，聚八方翘楚，领行业发展，成行业风向标。</span></p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\"><span style=\\\"margin: 0px; padding: 0px; font-family: 微软雅黑;\\\">• &nbsp;&nbsp; &nbsp;&nbsp;天地有域，大道无疆，长塑行长塑之道、兴长塑之林，独树长塑之人文精神和经营哲学，推动长塑永续发展，迈向全球</span></p><p><br/></p>\"}', null, '长青树', '0', '0', '20150414122006', '1'), ('318', '244', '一流的生产设备，一流的制造团队', '', '/wxadmin/upload/article/150413153853PEKPPFQ.jpeg', '{\"content\":\"<p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;长塑分别从德国、日本、奥地利等国，引进世界最先进的生产设备，目前拥有多条BOPA生产线。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;自动化程度高，性能稳定，可随时针对不同客户需求和市场变化情况调整产品结构，产品各项物理机械性能指标均达到世界先进水平，具有强劲的市场竞争力。</p><p style=\\\"margin: 10px auto; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 20px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;长塑拥有一支卓越、稳定的生产制造团队，不断进行生产技术、设备工程、管理技术改进、改善制程、节约能源等领域的改进、创新，致力于为客户提供高品质、稳定的产品，捍卫长塑在品质和成本方面的领先地位。</p><p><br/></p>\"}', null, '', '1', '0', '20150413153856', '0'), ('380', '249', '长塑，成就世界模范', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">&nbsp; &nbsp; &nbsp; 膜事业是长塑事业的起点，也是重点。长塑在已有资源、技术与规模优势的基础上，通过产品创新和经营领先策略，不断整合资源和创新技术，不断丰富膜产品的系列及品类，拓展膜产品的应用及推广，使长塑膜成为人类健康安全生活的卫士，使长塑成为中国膜领域的风向标，世界膜领域的领航者。</span></p>\"}', null, '', '4', '0', '20150414121550', '0'), ('394', '237', '《长塑之速》荣获中国品牌内刊•2014年度优秀“好杂志”一等奖', '', '/wxadmin/upload/article/150414150622TGWMKIL.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">2014年年底，《长塑之速》内刊参评《中国品牌内刊•2014年度优秀内部报刊评选和中国品牌内刊榜推荐活动》。经过评选办公室整理、评审委员会认真筛选评议，为期近5个月的评选评审后，2015年3月3日，《长塑之速》内刊最终从全国32个省市的企事业单位选送的刊物中，最终入选2014年度优秀内刊奖项名单，荣获2014年度优秀“好杂志”一等奖荣誉。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp; &nbsp; &nbsp; &nbsp;2014年，我们顺应公司发展战略规划、市场需求和企业文化发展步伐，对内刊进行了升级改版，并得到员工以及其他读者的一致好评。2015年，公司将加强与行业协会及知名企业内刊交流，并将向公众平台推送优质稿件，进一步加强内刊的质量提升。未来我们期许自我成长为公司内的人文内刊，行业内的品牌内刊，国内的优秀内刊，充分发挥内刊在企业文化建设、企业形象展示、企业品牌塑造、企业产品推广、客户关系维系等多方面的积极作用。</p><p><br/></p>\"}', null, '2014年年底，《长塑之速》内刊参评《中国品牌内刊•2014', '5', '0', '20150414122308', '0'), ('461', '294', '1221', '21212', '/wxadmin/upload/article/150515145803CZOLIQQ.jpeg', '{\"weiboName\":\"123213\",\"weiboDesc\":\"123213\",\"weibo\":\"123213\",\"weiboLogo\":\"/wxadmin/upload/article/150515145809CUUWVRG.jpeg\"}', null, '123123', '1', '0', '20150515145816', '0'), ('399', '238', '日本塑料/薄膜展：塑料材料的创新方向', '', '/wxadmin/upload/article/150414151322AACQNRF.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">平板显示(FPD)、有机发光电子版(OEL)、柔性电路板(FPC)、软性显示设备，这些专业词汇因智能设备普及而被普通民众逐渐熟知，4K超高清显示、曲面显示、可折叠屏幕等今年引爆的新技术，正指引着塑料材料新一轮的创新方向。在樱花季节刚刚过去的时候，记者在日本东京有明国际展览中心举行的第三届日本高功能塑料展(3rdPLASTICJAPAN)、第五届日本高功能薄膜展(5thFILMTECHJAPAN)上，充分感受到了这一点。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">手机、数码相机、平板显示、OEL……从十几年前的折叠手机，到最in的折叠屏幕手机，一应俱全。这个一下子吸引了记者目光的展台，位于展厅最东边入口处。它不是数码产品公司，也不是数码配件公司，而是一家规模不大的材料开发商——GOYO公司。细一打听，这家公司此次展出的主打产品是正在开发中的、具有高度形状保持性的膜产品。该产品以PET为基材，局部进行UV固化，热成型和真空压缩成型性好。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">“GOYO展出的一款产品在OD值(光密度)指标上有不小的优势，可以让电视的整机厚度变薄。以前的材料OD值是30，现在已经可以达到40以上了。不过这款产品还在开发中，这次我要了一些资料，回去研究一下看是否可以合作。”专程从广东来看展览的广州毅昌科技股份有限公司背光研究所所长陈金涌对记者说。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">富士胶片株式会社(FUJIFILM)重点推介的是一款可以实现高速成像、高画质、高色彩还原度的膜产品。这款产品由三层膜复合而成，仅中间层就至少集成了5种不同的技术。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">从小就使用富士胶卷的记者，这次终于抓住机会对数字时代的富士在干什么一探究竟。富士胶片株式会社研发本部总经理浅见正弘在展览上介绍道：“从基体材料的总体发展历史来看，如果说20世纪是材料合成的世纪，那么21世纪就是材料杂化改性的时期。”在他看来，膜材料复合化已经不可逆，通过对具有一定硬度的表层材料的改性来满足抗划，选用PET/PV来达到耐候的要求，透明导电膜来实现电子传输的要求，超疏水材料来提升耐水性……</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">浅见正弘表示：“今后工业和功能化学品的发展方向将主要集中在电子电气产品、汽车和宇宙空间领域、生命医药科技、水处理和食品工业，以及解决环境和能源问题。而在电子设备领域，其方向主要是为智能手机/平板配套的功能化材料，以及下一代电子设备所需要的材料，这恰恰是FUJIFILM的战略重点。”</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">凹版印刷株式会社带来了全球首款渗透指标(lineup)低至10-5~10-3g/cm2·day的下一代阻隔级膜产品。凹版印刷株式会社商务发展和研究部本部长伊沢太郎说：“出于环境友好的考虑，我们必须同时达到透明性最大化和高阻隔性能。除了传统的阻隔领域，该产品还可以用于电子书生产，作为电子纸张的保护层，保护其不受潮湿的影响;也可以作为EL/柔性太阳能电池的材料，不仅让产品变轻薄，同时高阻隔性能还能够降低产品划伤和折断的风险。通过我们的努力，该产品已能量产。”</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">水处理膜产品在中国知名度非常高的东丽工业公司，则重点推出了一款可加强金属光泽的纳米膜。该产品对电波有良好的透过性，防尘且易成型，已在智能手机、笔记本电脑、家用电器、汽车等领域获得应用。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">放眼望去，Somar公司、TOYO公司的防指纹、防粘污膜，Momentive公司的平板显示组装黏合剂、OLED材料……塑料、膜材料展上让你眼花缭乱的智能显示材料，与隔壁展厅平板显示的热闹场景，真是遥相呼应!难怪展览主办方日本励展公司称“Pad”素材是今年展会的大亮点。</p><p><br/></p>\"}', null, '平板显示(FPD)、有机发光电子版(OEL)、柔性电路板（F', '4', '0', '20150414122414', '0'), ('396', '238', '尼龙“冷转移”技术开辟尼龙印花新途径', '', '/wxadmin/upload/article/150414150606GIIMUXA.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">尼龙不耐热，无法承受传统印花方式下产生的热量，这是纺织印花中一个瓶颈。近日，位于吴江盛泽的易瑞纺织整理有限公司，斥巨资研发的尼龙“冷转移”印花技术，一举打破了这一技术限制，开辟了尼龙印花新途径。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 尼龙是世界上出现的第一种合成纤维，具有高强度、高耐磨性、高抗化学性等特点。做成面料后，不仅光泽度高，而且手感较滑。但是，尼龙也有短板，不易着色，导致市面上大多数尼龙面料色彩单一，无法满足市场需要。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; “为了保留尼龙纤维特有的性质，一般对其后加工的温度在160℃。传统水印花技术虽然可以满足这一温度的要求，但花形尺寸及效果、颜色套数以及面料高损耗，严重限制了高端尼龙面料的设计与开发。”易瑞纺整董事长顾明伟说，采用常规热转移印花技术，虽然可以实现花形尺寸及效果的突破，但热升华时的温度高达200℃以上，极大破坏了尼龙面料独有的特性，而且颜色稳定性差，会随着温度及湿度无规则变化。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 如何从这些传统工艺中萃取精华，并将它们完美结合?2011年，易瑞纺整与与常州一研发机构合作，开始攻克这一行业性难题。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 顾明伟首先将方向瞄准了常温印花。此举在技术上并不难，但问题随之而来。采用热转移印花纸作“印花”载体，温度降低后，转移印花纸的“印花”能力大幅下降，色彩损耗严重。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; “要想突破这一瓶颈，就得从‘载体’上动脑筋。”经过反复试验，一种特殊的薄膜进入了顾明伟的视线。“薄膜不会吸收染料，不产生损耗，印好后没有残留。而且，薄膜替代纸张更加节能环保。”同时，研发团队又不断改进染料成分与设备工艺的适应性。历时两年，成功掌握尼龙“冷转移”印花技术。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 该技术采用四分色分色原理，可以在织物上印制出具有层次感、色彩丰富的图案。整个印花过程在常温下进行，可保持超薄型尼丝纺的柔软手感、酸性染料的完美应用，以及印后的蒸化水洗工艺，使得冷转印的色牢度在各方面都表现得十分优异。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 记者在该公司展示厅内看到，这里陈列的尼龙面料，均为细支高密产品，色彩丰富、立体感强。尤其是一款迷彩面料，远看就像一片树林，非常逼真。顾明伟说，借助这一创新的技术，他们已获发明专利1项，实用新型专利2项，做出的花形达两三百个，并吸引了大批国内外品牌采购商前来合作。</span></p>\"}', null, '尼龙不耐热，无法承受传统印花方式下产生的热量，这是纺织印花中', '2', '0', '20150414122329', '0'), ('358', '248', '长塑简介', '', '/wxadmin/upload/article/150414120305BYKHSJZ.jpeg', '{\"content\":\"<p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\">厦门长塑实业有限公司是一家集绿色生活材料研发、制造与营销为一体的科技型企业，是全球最大的BOPA双向拉伸尼龙薄膜生产商，中国领先的绿色生活材料提供商。公司秉承着“长久呵护你我健康家园，倾力塑造人类绿色空间”的企业使命，立足绿色生活材料领域，整合全球先进资源与技术，不断创新与发展，致力于实现“成为世界级绿色生活材料的引领者”的企业愿景。</p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公司拥有按国家级工程技术研究中心标准建设的高分子新材料实验室，并已建成一支高素质、专业化的研发团队，同时还聘请国外产业技术综合研究所首席研究官作为公司技术顾问。公司长期开展深度“产学研”合作，已与杭州师范大学合作设立“长塑新材料研发中心”，并与中国科学院、厦门大学、知名高分子材料研究机构及业内一流企业达成战略合作。自创立以来，长塑始终立足科技创新，自主研发的生产工艺和产品配方现已取得多项国家发明专利。</p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公司本着“速以制胜 恒以致远”的企业精神，经过多年发展与积淀，形成了科学的耕耘式管理体系，并拥有一支优秀的企业经营与管理团队。同时，公司从德国、奥地利等国引进尖端的研发生产设备和精湛的检测技术，可随时为市场提供全方位高品质产品与服务。目前，公司产品行销全国三十多个省、市、自治区乃至全球，优质的产品和服务赢得了广大客户的一致赞誉。</p><p style=\\\"margin: 2px auto 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 21px; white-space: normal;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;未来，长塑不仅致力于用科技为人类提供更多更优质的绿色生活材料产品，同时也为人类提供品质生活的解决方案。长塑重视企业的永续经营，也重视企业与人、自然、社会的和谐共生，共同发展。长塑关注健康安全、环境友好和资源节约，着力塑造人文长塑、科技长塑、生态长塑，专注于绿色生活材料的持续创新与发展，为改善人类生活品质和生态环境而不懈努力，致力于成为社会的优秀企业公民。</p><p><br/></p>\"}', null, '', '11', '0', '20150414120310', '0'), ('405', '239', 'BOPA薄膜特性', '', '/wxadmin/upload/article/150414150545WLVFIXJ.jpeg', '{\"content\":\"<p><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">一、</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">BOPA</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">薄膜物理机械性能</strong><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　PA薄膜是一种优良的包装材料，其主要物理机械性能为：</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　1、拉伸强度高、耐磨性好、软化点高，可经受约140℃的高温蒸汽消毒，在干燥条件下能耐更高温度，一般使用温度为-60℃--150℃。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　2、具有优良的耐冲击性和爆破强度，易于热封，可利用高频法焊接。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　3、对气味阻隔性好，对湿气参透性较高，水蒸气的渗透率随着温度和相对湿度增加而增大，可用于真空包装。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　4、透光性好，经过双向拉伸后，光泽性有明显的改善，力学性能明显提高，水蒸气和空气渗透率有较大降低。</span></p><p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><br/></strong></span></p><p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">二、双向拉伸</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">PA</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">薄膜使用的原料：</strong><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　PA一般称为尼龙，它是一种半结晶性的塑料，分子与分子之间存在着较强的氯键作用，因为这种材料有较多的结晶和较强的分子间的作用力，因此这种材料比较难拉伸。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　目前用于生产双向拉伸的尼龙薄膜的材料并不多，常用的为尼龙6和尼龙66等，但是一般包装材料中大多数还是以尼龙6为主。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　生产尼龙薄膜所用的树脂一般都是专用的，假如在树脂合成过程中预先加入适量的添加剂（二以氧化硅为主），生产时可以直接使用，不必进行配料、混合。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　生产尼龙6薄膜的树脂PA6吸湿性较大，其特性粘度约为3.5，相对粘度约为2.7~3.5，原料中的水份含量一般为0.6％。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　</span><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">　三、双向拉伸</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">PA</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">薄膜的生产设备</strong><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　平面BOPA薄膜的生产设备与拉伸BOPET 薄膜的生产设备基本相似，都具有从干燥到收卷的主机，也有再造粒回收、分切等辅助设备。然而，由于物料的性质不同，某些设备的具体结构和参数也有区别。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　通常，BOPA的干燥装置是采用气流干燥或真空干燥装置，挤出机使用分离型的单螺杆，过滤系统多用管式滤芯。模头为衣架式自动可调的，并用测厚仪进行自动反馈以控制机唇开口间隙，冷却方式一般采用单鼓加静电附片的方法，若材料粘度大些可采用气刀贴附。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　在尼龙薄膜生产中，纵向拉抻设备分预热、拉伸、冷却三个区域，有高速、低速两个传动系统和压紧辊等，但它的非凡之处在于纵向拉伸温度较低，预热辊较少，拉伸时不需要附助加热器，仅需要进行单点拉伸即可。横向拉伸机由于拉伸温度、热定型和冷却温度相差很大，因此在定型区的前后位置都要设有缓冲区，横向拉伸比较小，各区的长度不同，预热拉伸较短，热定型区较长。冷却区一般采用自然风冷却。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">　　四、</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">BOPA</strong><strong style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\">薄膜的生产工艺条件</strong><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　在挤出片材之前，尼龙6树脂必须进行充分的干燥处理，否则在挤出时会产生严重地降解，片上出现气泡，薄膜出现雾化等异常现象，影响薄膜的性能和成膜性。通常，干燥温度90℃左右。干燥后树脂的含水率﹤0.1％。经过干燥处理的尼龙6在240-260℃的进行挤出，熔体经过过滤器、计量泵、静态混合器、机头流到20-40℃的冷却鼓面上，制成厚度良好的片材。尼龙6片材在45-55℃的温度下进行纵向拉伸，拉伸倍数为2.5-3.0。2.5~3.2倍拉伸后薄膜在30℃左右的温度下冷却，接着进入横向拉伸机。经过70-80℃的预热区，并在略高的温度下，拉伸2.5-3.0倍，在200-220℃温度下进行热定型处理，最后进行自然冷却，便制成所需的尼龙薄膜。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　由于尼龙具有很强的吸湿性，生产线上收卷的母卷要采用防潮措施，并尽快进行分切。分切的产品也必须利用防潮、隔湿的材料（如铝箔等）进行包装，防止薄膜吸湿，性能下降。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　印刷、镀铝等需要表面张力较大的尼龙薄膜，在拉伸后需要经过电晕处理，使薄膜表面张力由40mN/m提高至52~54mN/m。</span></span></p>\"}', null, '一、BOPA薄膜物理机械性能\n　　PA薄膜是一种优良的包装材', '1', '0', '20150414122538', '0'), ('328', '236', '尼龙“冷转移”技术开辟尼龙印花新途径', '', '/wxadmin/upload/article/150413155603DKEEUSU.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">尼龙不耐热，无法承受传统印花方式下产生的热量，这是纺织印花中一个瓶颈。近日，位于吴江盛泽的易瑞纺织整理有限公司，斥巨资研发的尼龙“冷转移”印花技术，一举打破了这一技术限制，开辟了尼龙印花新途径。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 尼龙是世界上出现的第一种合成纤维，具有高强度、高耐磨性、高抗化学性等特点。做成面料后，不仅光泽度高，而且手感较滑。但是，尼龙也有短板，不易着色，导致市面上大多数尼龙面料色彩单一，无法满足市场需要。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; “为了保留尼龙纤维特有的性质，一般对其后加工的温度在160℃。传统水印花技术虽然可以满足这一温度的要求，但花形尺寸及效果、颜色套数以及面料高损耗，严重限制了高端尼龙面料的设计与开发。”易瑞纺整董事长顾明伟说，采用常规热转移印花技术，虽然可以实现花形尺寸及效果的突破，但热升华时的温度高达200℃以上，极大破坏了尼龙面料独有的特性，而且颜色稳定性差，会随着温度及湿度无规则变化。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 如何从这些传统工艺中萃取精华，并将它们完美结合?2011年，易瑞纺整与与常州一研发机构合作，开始攻克这一行业性难题。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 顾明伟首先将方向瞄准了常温印花。此举在技术上并不难，但问题随之而来。采用热转移印花纸作“印花”载体，温度降低后，转移印花纸的“印花”能力大幅下降，色彩损耗严重。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; “要想突破这一瓶颈，就得从‘载体’上动脑筋。”经过反复试验，一种特殊的薄膜进入了顾明伟的视线。“薄膜不会吸收染料，不产生损耗，印好后没有残留。而且，薄膜替代纸张更加节能环保。”同时，研发团队又不断改进染料成分与设备工艺的适应性。历时两年，成功掌握尼龙“冷转移”印花技术。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 该技术采用四分色分色原理，可以在织物上印制出具有层次感、色彩丰富的图案。整个印花过程在常温下进行，可保持超薄型尼丝纺的柔软手感、酸性染料的完美应用，以及印后的蒸化水洗工艺，使得冷转印的色牢度在各方面都表现得十分优异。&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\\\">&nbsp;&nbsp; 记者在该公司展示厅内看到，这里陈列的尼龙面料，均为细支高密产品，色彩丰富、立体感强。尤其是一款迷彩面料，远看就像一片树林，非常逼真。顾明伟说，借助这一创新的技术，他们已获发明专利1项，实用新型专利2项，做出的花形达两三百个，并吸引了大批国内外品牌采购商前来合作。</span></p>\"}', null, '', '0', '0', '20150413155613', '0'), ('392', '237', '厦门市委书记、市长一行到我司调研指导', '', '/wxadmin/upload/article/150414154524VWRMTZG.jpeg', '{\"content\":\"<p style=\\\"margin: 8px 0;padding: 0px;font-size: 12px;color: rgb(102, 102, 102);font-family: Arial, 微软雅黑;line-height: 24px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\\\">2015年3月3日下午，省委常委、市委书记王蒙徽，市长裴金佳，市领导钟兴国、臧杰斌、郑云峰、李栋梁、倪超来到海沧区，先后调研了我司及其他多家企业，指导海沧区全面实施美丽厦门战略规划。<br style=\\\";padding: 0px\\\"/></p><p style=\\\"text-align:center\\\"><span style=\\\";padding: 0px;font-family: 宋体\\\"><span style=\\\";padding: 0px;font-family: Arial, 微软雅黑\\\"><span style=\\\";padding: 0px\\\"><img alt=\\\"\\\" src=\\\"/wxadmin/ueditor/jsp/upload/image/20150414/1428995354510009565.jpg\\\" style=\\\"padding: 0px; border: 0px; vertical-align: top; width: 302px; height: 185px;\\\" width=\\\"302\\\" height=\\\"185\\\"/></span></span></span></p><p style=\\\"margin-top: 0px;margin-bottom: 0px;padding: 0px;font-size: 12px;color: rgb(102, 102, 102);font-family: Arial, 微软雅黑;line-height: 24px;white-space: normal;background-color: rgb(255, 255, 255)\\\">&nbsp;</p><p style=\\\"margin: 8px 0;padding: 0px;font-size: 12px;color: rgb(102, 102, 102);font-family: Arial, 微软雅黑;line-height: 24px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\\\">我司颜艺林总裁向市领导作了企业发展规划报告。他说，我司是世界规模最大的BOPA制造商，市场占有率已居世界领先行列，目前还在扩建生产线。在建的3号厂房磁悬浮生产线投产在即。随着生活节奏加快，生活水平提高，食品安全问题推动人们对包装材料的高要求，也拉动了对BOPA需求。尼龙薄膜产业是关乎民生健康的产业，因此，我们非常重视安全生产，引进日本捷太格特的技术，同时从全世界知名企业聘请高级工程师，确保做好安全生产工作。厂房旁边的舒港快速路建设时，王书记帮忙协调增加了安全隔离带，保障了我司的生产安全。海沧投资氛围很好， 办事效率很高，帮助了我们快速建设世界级产线。我们将再接再厉，争取两年后，成长为厦门百亿级的民营企业。</p><p style=\\\"margin: 8px 0;padding: 0px;font-size: 12px;color: rgb(102, 102, 102);font-family: Arial, 微软雅黑;line-height: 24px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 28px\\\">王蒙徽书记和裴金佳市长充分肯定了我司在推进创新驱动和转型发展上取得的成绩。王书记表示，活力海沧的态势在逐步展现，转型发展的成效不断凸显，干部群众干事创业的精神令人振奋。这说明海沧区目前的发展方向是正确的，措施是有力的，希望海沧区企业继续按照这一方向坚定走下去。</p><p><br/></p>\"}', null, '2014年12月11日-12日，经过SGS国际认证服务部的现', '5', '0', '20150414122249', '0'), ('424', '249', '环境与健康安全方针', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 关注健康安全：长塑为客户提供健康安全的产品，并以此作为消费者健康安全生活的卫士；我们重视生产经营的全业务链上的健 康安全管控，追求零污染；并重视为员工提供健康、安全、舒适的工作生活环境；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 关注环境友好：长塑坚信良好的环境是我们赖以生存和发展的空间，我们不以牺牲环境为代价获取企业发展，为此，我们遵守环境法规，我们重视环境保护，我们拒绝环境污染，并持续改进，努力使我们的产品在废弃时可降解或可再生； \\n</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 关注资源节约：长塑坚信资源是我们赖以生存和发展的基石，资源是会枯竭的，我们重视资源保护和 再利用，提高资源利用水平、利用率和节能减排，并努力使资源价值最大化。</span></p><p><br/></p>\"}', null, '', '0', '0', '20150414142041', '0'), ('444', '274', '123', '123', '', '{\"content\":\"<p>123</p>\"}', null, '213', '6', '0', '20150424223256', '0'), ('385', '223', '品牌内涵', '', '', '{\"content\":\"<p>• &nbsp; &nbsp; &nbsp;LOGO以环保的绿和科技的灰为主色调，和谐搭配，同时以「树叶」元素为设计基点，进行艺术变形，形象体现长塑致力于发展以科技创新为核心的绿色事业，以及在现代工业发展和自然资源不可再生的矛盾之间，追求人和自然的和谐永续发展。</p><p>• &nbsp; &nbsp; &nbsp;绿叶形状是“长”的拼音首字「C」变形，四片叶子又形成“塑”的拼音首字母「S」的变形，叶子环环相扣形成奔跑的「人」，极富速度感和动态感，寓意长塑「五速发展策略」和生生不息的基业，使「长塑之树，绿色长青」的诉求。</p><p>• &nbsp; &nbsp; &nbsp;四片叶子首尾相连，成立体环形，形式地球。寓意长塑引领全球绿色事业，纳世界英才，携手共创；集四方资源，团结协作，以「长久呵护你我健康家园，倾力塑造人类绿色空间」为使命，共谋发展。</p><p>• &nbsp; &nbsp; &nbsp;四片叶子分别代表企业核心价值观中的担当、拼搏、创造、成长；</p><p>• &nbsp; &nbsp; &nbsp;四片叶子是《易经》太极图的演变，无极生太极，太极生两仪，两仪生四象。象征着长塑立足于中国，放眼世界，同时也寓意着长塑未来是走多元化发展道路。</p><p>• &nbsp; &nbsp; &nbsp;四片叶子由一个不断旋转的风车演变而来，寓意着长塑通过不断创新绿色生活材料，为人类创造更加健康安全的高品质生活，朝着时代赋予的使命追求不息，奋斗不止。</p><p><br/></p>\"}', null, '', '5', '0', '20150414121902', '0'), ('402', '232', '其他应用', '', '/wxadmin/upload/article/150414164918UUMKFDY.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\"></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">气球、真空绝热板、化工原料包装袋（大容量包装）……<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;气球，BOPA镀铝后与PE复合，防气性、成形性和热封性能优异。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;真空绝热板主要用于保温绝热，如家用冰箱、游艇冰箱、迷你冰箱、车载冰箱、深冷冰柜、电热水器、自动贩卖机、冷冻箱、冷藏集装箱、建筑墙体保温和LNG储运等。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;化工原料包装袋（大容量包装），韧性好、抗冲击，抗跌落，密封性好，耐刺穿，强度高，印刷性好。</span></p><p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\"></span><br/></p><p><br/></p>\"}', null, '', '1', '0', '20150414122449', '0'), ('403', '239', '功能膜让包装插上科技的翅膀', '', '/wxadmin/upload/article/150414151438CHULWPT.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;文章来源:CPRJ 中国塑料橡胶&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 中包联塑料委专家委员会副主任兼秘书长、上海市包装技术协会专家委员会专家 陈昌杰&nbsp;&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 16px; color: rgb(211, 5, 108);\\\">活性阻隔性包装薄膜</span></strong></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">活性阻隔包装薄膜又分吸氧型和吸水型等不同形式的阻隔薄膜。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">吸氧型阻隔包装薄膜和传统的阻隔包装薄膜不同，它不仅能有效阻止氧气通过薄膜，而且能将残留在塑料薄膜袋中的氧气吸收，使包装袋中的氧气长期保持在一个很低的水平，从而有效延长商品的货架期。近年来在日本等工业发达国家，该膜已得到工业化生产，使用效果良好。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">吸氧型阻隔包装薄膜是一种含活性包装材料层（吸氧材料层）的复合薄膜。吸氧薄膜用于包装之后，包装袋内残存的氧通过热封层进入吸氧层，在吸氧层中氧与活性包装材料进行化学反应而被消耗掉。利用吸氧薄膜包装食品等商品，包装时不必在袋内装入吸氧剂，简化了包装程序，而且避免了消费者误食吸氧剂的弊端。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">吸氧材料可以是将还原铁</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">氯化钠、亚硫酸钠、抗坏血酸等作为反应物，掺混到树脂中的产物，或者采用</span><span style=\\\"margin: 0px; padding: 0px;\\\">MXD6</span><span style=\\\"margin: 0px; padding: 0px;\\\">尼龙</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">钴盐，双键系聚合物</span><span style=\\\"margin: 0px; padding: 0px;\\\">/&nbsp;</span><span style=\\\"margin: 0px; padding: 0px;\\\">盐，含环己烯侧链的聚合物</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">盐等物质的掺混物。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">吸氧型阻隔包装薄膜也可将反应物掺混到聚烯烃中制得吸氧材料，将它置于封合层和粘合层之间，制取一个独立的吸氧层。虽然这会增加复合薄膜的层数，制造成本有所增加，但由于该层在阻隔层的内侧，对于吸收袋内氧气，将表现出更佳的效果。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">日本东洋制罐生产了一种以还原铁和氯化钠为触媒的树脂掺混型吸氧阻隔性材料，可用于蒸煮袋、输液外包装袋、含维他命</span><span style=\\\"margin: 0px; padding: 0px;\\\">C</span><span style=\\\"margin: 0px; padding: 0px;\\\">的美容面膜的包装袋等。经测定，其样品膜的吸收氧能力为</span><span style=\\\"margin: 0px; padding: 0px;\\\">0.3ml/cm2</span><span style=\\\"margin: 0px; padding: 0px;\\\">，并可通过掺混吸氧剂的量的变化控制薄膜的吸氧量。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">日本东洋制罐公司还开发了另一种活性包装薄膜，即吸水型阻隔包装薄膜，该膜除具有阻隔性之外，还能吸收薄膜袋中的水分，结构为：外层</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">活性阻隔层</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">支撑层</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">吸水层</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">内层。吸水性薄膜的应用为临床检查药、粉末状绿茶等，由于包装材料本身具吸湿性功能，应用吸水性薄膜时，不必将硅胶或氯化钙等干燥剂和内容物一起装入袋中封存。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">日本共用印刷公司也成功开发了一种吸湿性包装材料，现在正开发在医药品、电子部件等包装的应用。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 16px; color: rgb(211, 5, 108);\\\">抗菌性高阻隔薄膜</span></strong></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">采用纳米抗菌技术与共挤流延加工工艺相结合，研制的抗菌型高阻隔包装薄膜，对延长食品的货架期，表现出良好的效果，应用于槟榔包装取得了很好的成效。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">抗菌性高阻隔薄膜的结构为：</span><span style=\\\"margin: 0px; padding: 0px;\\\">PE40/AD10/EVOH20/AD10/</span><span style=\\\"margin: 0px; padding: 0px;\\\">抗菌</span><span style=\\\"margin: 0px; padding: 0px;\\\">PE40</span><span style=\\\"margin: 0px; padding: 0px;\\\">，膜厚为</span><span style=\\\"margin: 0px; padding: 0px;\\\">120</span><span style=\\\"margin: 0px; padding: 0px;\\\">μ</span><span style=\\\"margin: 0px; padding: 0px;\\\">m</span><span style=\\\"margin: 0px; padding: 0px;\\\">。该膜中间层采用阻隔性能优异的</span><span style=\\\"margin: 0px; padding: 0px;\\\">EVOH</span><span style=\\\"margin: 0px; padding: 0px;\\\">树脂，是阻隔性能非常好的树脂，可屏蔽特殊的香味并防止槟榔在存贮过程中发霉；内层采用抗菌聚乙烯层，增强防霉效果，同时它具有良好的热封性能，为制袋操作提供良好的条件；外层采用普通的聚乙烯，以保持较低的成本。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">抗菌性高阻隔薄膜的生产先用分散剂等助剂处理纳米抗菌剂，再与聚乙烯混合，用双螺杆挤出机造粒得到抗菌聚乙烯母料，抗菌聚乙烯母料与聚乙烯树脂共混，得到用于共挤复合使用的抗菌聚乙烯粒料。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">槟榔为经特殊加工处理的产品，要求产品口味纯正、香气浓郁，传统铝塑复合包装槟榔的保质期约在三个月左右，抗菌高阻隔包装的保质期在六个月以上。包装成本上抗菌高阻隔薄膜袋也有较大优势，铝塑复合袋的成本（</span><span style=\\\"margin: 0px; padding: 0px;\\\">64</span><span style=\\\"margin: 0px; padding: 0px;\\\">克袋）为人民币</span><span style=\\\"margin: 0px; padding: 0px;\\\">0.15</span><span style=\\\"margin: 0px; padding: 0px;\\\">元</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">个，而纳米抗菌高阻隔包装袋约人民币</span><span style=\\\"margin: 0px; padding: 0px;\\\">0.11</span><span style=\\\"margin: 0px; padding: 0px;\\\">元</span><span style=\\\"margin: 0px; padding: 0px;\\\">/</span><span style=\\\"margin: 0px; padding: 0px;\\\">个，成本降低</span><span style=\\\"margin: 0px; padding: 0px;\\\">25%</span><span style=\\\"margin: 0px; padding: 0px;\\\">以上。实践表明，抗菌高阻隔薄膜用于槟榔包装不仅可以大大地延长商品的保质期，减少商品的腐败变质，而且还能降低包装成本。抗菌高阻隔薄膜是一种值得深入研究、大力推广的新产品。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; color: rgb(211, 5, 108);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 16px;\\\">气相防锈塑料薄膜</span></strong></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">气相防锈塑料薄膜又称气化性防锈薄膜，它是将气相腐蚀抑制剂（</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">）混合在聚乙烯中制成的薄膜。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">常温下，气相腐蚀抑制剂分子具有比空气高的气化性，其分子从薄膜中释放（挥发）出来，进入封闭的包装空间。气相腐蚀抑制剂一旦与所包装的金属表面接触，其分子即浓缩并被湿气分解，形成自由离子溶入电解质中。电解质中的离子同</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">离子发生反应，取代金属分子附着在金属表面上，抑制腐蚀金属的电化学反应发生。气相腐蚀抑制剂分子逐渐慢慢地挥发，使包装的空间内始终处于“饱和”状态，达到长期稳定的防锈效果。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">气相防锈具有聚乙烯的特点：不受盐类、腐蚀性气体、高温、高湿影响，产品的外面包装一层</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">防锈膜，就可以发挥超强防锈功能，防锈效果显著，克服了传统方法对产品的保护不充分的弊端，特别适用于金属、机电产品在加工、仓储、海上运输以及外商对进出口产品的高质量防锈要求。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">气相防锈应用时包装效率高。可用袋装，也可利用胶带、订书机等简单封合即可，易实现防锈、包装自动化；省工、省时、节约成本，综合经济效益显著。此外，环保性好，不需要上油，不致产生因上油对环境造成的严重污染。同时，防锈时间长，海运防护可达</span><span style=\\\"margin: 0px; padding: 0px;\\\">2</span><span style=\\\"margin: 0px; padding: 0px;\\\">年以上，仓储保护可达</span><span style=\\\"margin: 0px; padding: 0px;\\\">5</span><span style=\\\"margin: 0px; padding: 0px;\\\">年以上。最后，</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">防锈膜透明性好，不用打开包装就可看清膜内物体的状况。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">用</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">膜作为防锈包装，较传统的防锈工艺可以少</span><span style=\\\"margin: 0px; padding: 0px;\\\">5</span><span style=\\\"margin: 0px; padding: 0px;\\\">道工序，减少大量的人力、物力。传统的防锈工艺为：产品→防锈设备→上防锈油→凉干→去除残油→包装→运输→打开包装→去油→使用。而</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">膜防锈工艺为：产品→</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">膜包装→运输→打开包装→使用。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">为对</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">膜包装与传统包装方式的防锈效果进行比较，采用钢材</span><span style=\\\"margin: 0px; padding: 0px;\\\">HT300</span><span style=\\\"margin: 0px; padding: 0px;\\\">做了盐雾、湿热、室内存放三组对比试验。其中，盐雾、湿热试验中，采用气相防锈塑料薄膜包装的钢材比涂油</span><span style=\\\"margin: 0px; padding: 0px;\\\">塑料膜包装的生锈时间更晚；在室内存放，两者都是</span><span style=\\\"margin: 0px; padding: 0px;\\\">180</span><span style=\\\"margin: 0px; padding: 0px;\\\">天未生锈。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">从</span><span style=\\\"margin: 0px; padding: 0px;\\\">2001</span><span style=\\\"margin: 0px; padding: 0px;\\\">年开始，国内某汽车公司已采用了</span><span style=\\\"margin: 0px; padding: 0px;\\\">VCI</span><span style=\\\"margin: 0px; padding: 0px;\\\">膜的包装方式代替原有的涂油包装，实践证明采用气相防锈薄膜包装具有众多优势，包括优异的防锈效果，良好的工作环境，较低的综合包装成本等，深受用户欢迎。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">中国</span><span style=\\\"margin: 0px; padding: 0px;\\\">2011</span><span style=\\\"margin: 0px; padding: 0px;\\\">年塑料制品的产量</span><span style=\\\"margin: 0px; padding: 0px;\\\">5474</span><span style=\\\"margin: 0px; padding: 0px;\\\">万吨，其中塑料薄膜约占</span><span style=\\\"margin: 0px; padding: 0px;\\\">15%</span><span style=\\\"margin: 0px; padding: 0px;\\\">，而塑料薄膜中</span><span style=\\\"margin: 0px; padding: 0px;\\\">80%</span><span style=\\\"margin: 0px; padding: 0px;\\\">左右用于包装，因此，包装在整个塑料制品和塑料薄膜中都具有极其重要的地位。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\">塑料薄膜是指厚度在</span><span style=\\\"margin: 0px; padding: 0px;\\\">0.25mm</span><span style=\\\"margin: 0px; padding: 0px;\\\">（即</span><span style=\\\"margin: 0px; padding: 0px;\\\">250</span><span style=\\\"margin: 0px; padding: 0px;\\\">μ</span><span style=\\\"margin: 0px; padding: 0px;\\\">m</span><span style=\\\"margin: 0px; padding: 0px;\\\">）以下的平整而柔软的塑料制品，按照用途不同，可分为包装薄膜、农用薄膜、工业用薄膜、医用薄膜等。其中，功能性包装薄膜近年发展很快，并越来越为业界所重视。</span></span></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: small;\\\"><span style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12px;\\\">功能性包装薄膜也被称为差异性包装薄膜，指具有普通薄膜没有的某些特殊功能的薄膜。特殊功能的引入使薄膜的包装效果明显改善，附加价值明显提升，开发、应用功能性塑料包装薄膜往往能够得到社会效益和经济效益双丰收。这里介绍几个功能性塑料包装薄膜的品种。</span></span></span></p><p><br/></p>\"}', null, '活性阻隔性包装薄膜\n   活性阻隔包装薄膜又分吸氧型和吸水型', '0', '0', '20150414122500', '0');
INSERT INTO `gd_article` VALUES ('335', '222', '长久呵护你我健康家园-倾力塑造人类绿色空间', '', '/wxadmin/upload/article/150413160004VEKTHTH.plain', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">长塑是一家提供绿色生活材料的科技型企业，致力于人类生活品质的改善和提高。我们不断追求客户、股东、员工、合作伙伴、社会的和谐共生，共同发展，也关注健康安全、环境友好和资源节约，并致力于成为社会的优秀企业公民。&nbsp;</span></p>\"}', null, '', '0', '0', '20150413160039', '0'), ('463', '297', 'q\'we', 'q\'we', '', '{\"banlichuankou\":\"气温\"}', null, '请问请问', '1', '0', '20150519163012', '0'), ('337', '222', '成为世界级绿色生活材料的引领者', '', '/wxadmin/upload/article/150413160004VEKTHTH.plain', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">长塑定位于绿色生活材料领域，以膜事业为起点，速育才、速创新、速周转、速覆盖、速扩张，通过组织升级和业务转型，立足绿色生活材料领域，从单一产品到多系列产品，从单一品类到多品类，从单一领域应用到多领域应用，从区域性到步入国际化。&nbsp;</span></p>\"}', null, '', '0', '0', '20150413160115', '0'), ('374', '249', '成为世界级绿色生活材料的引领者', '', '', '{\"content\":\"<p>\\n    <span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">&nbsp; &nbsp; &nbsp; 长塑定位于绿色生活材料领域，以膜事业为起点，速育才、速创新、速周转、速覆盖、速扩张，通过组织升级和业务转型，立足绿色生活材料领域，从单一产品到多系列产品，从单一品类到多品类，从单一领域应用到多领域应用，从区域性到步入国际化。&nbsp;</span>\\n</p>\"}', null, '', '4', '0', '20150414121338', '0'), ('397', '238', '浙江开发食品塑料包材中酞酸酯检测新法', '', '/wxadmin/upload/article/150414151332TACHEOQ.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">近日，由国家日用小商品质量监督检验中心承担的浙江省质监局科研项目“塑料食品包装材料中酞酸酯类化合物的迁移规律及SPME-GC-MS测定方法的研究”通过了验收。</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">据了解，该项目针对食品塑料包装材料中的酞酸酯类化合物，应用现代分析测试手段检测食品包装材料中6种酞酸酯类化合物，并采用4种物质模拟食品，探索塑料包装袋中常见3种酞酸酯的迁移规律，建立了固相微萃取-气相色谱-质谱联用同时测定食品塑料包装袋中酞酸酯类化合物的分析方法。这也是国内首次使用该方法检测食品塑料包装材料中的酞酸酯。该项目的顺利验收，对促进中心整体科研能力的提升起到了积极的推动作用。</p><p><br/></p>\"}', null, '近日，由国家日用小商品质量监督检验中心承担的浙江省质监局科研', '0', '0', '20150414122348', '0'), ('398', '232', '日化用品', '', '/wxadmin/upload/article/150414164736XKGJZBK.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\"></span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">肥皂粉袋、洗衣液袋、农药包装袋、被服压缩袋 ……<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;液体清洁立体袋，强度高，耐冲击，耐爆裂，阻隔好、刚性好、能挺立，耐应力开裂，阻隔性好，材料性好，适用于立体包装袋；底部柔性好，适用于加工；内层为改性PE，抗封口污染性好。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;农药包装袋，韧性好、抗冲击，抗跌落，密封性好，耐刺穿，强度高，印刷性好。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;重包装袋（米、豆、化肥），柔韧性、耐跌落，</span></p><p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\"></span><br/></p><p><br/></p>\"}', null, '', '6', '0', '20150414122353', '0'), ('400', '232', '医药电子', '', '/wxadmin/upload/article/150414164700ZIYRMLK.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">血液袋、输液袋等医疗器材、PTP药品泡罩包装、机械精密仪器、防静电电子产品包装、气柱缓冲包装袋、锂电池包装<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;药品稳定可靠、易实现少计量和系列包装、工艺先进、安全卫生、携带与使用方便、储存期长，适应性和外观良好，而且具有标识、防伪等功能。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;泡罩包装有极高的机械强度、阻隔强度，优良的抗冲击性能，并具有一定的耐磨和抗穿刺能力，对整个包装起机械的保护作用。一般采用高强度、阻隔强度良好、抗冲击性能优异的25um厚度双向拉伸尼龙薄膜（BOPA）作为表面支持强度层。</span></p><p><br/></p>\"}', null, '', '0', '0', '20150414122422', '0'), ('378', '249', '速以制胜 恒以致远', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 速以制胜。长塑以膜事业为起点，速育才、速创新、速周转、速覆盖、速扩张，实现了跨越式发展；&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 恒以致远。长塑立足绿色生活材料领域，恒拼搏、恒创新、恒专注、恒汲取、恒突破，努力实现基业长青。</span></p>\"}', null, '', '2', '0', '20150414121459', '0'), ('393', '232', '食品包装', '', '/wxadmin/upload/article/150414171933DGMKHBX.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">水煮、蒸煮食品、冷冻食品包装、汤面液体调料包装、耐蒸煮食品……<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;冷冻食品包装，主要利用BOPA 薄膜强度高、耐穿刺性好、耐寒性优的特性。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;汤面液体调料包装，主要利用其强度高、耐穿刺性好、特别耐油性。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br/></p><p><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;耐蒸煮食品包装，主要利用其耐油、耐热、气体阻隔性好，具有耐穿刺性等特点。</span></p><p><br/></p>\"}', null, '', '1', '0', '20150414122253', '0'), ('339', '222', '长塑，成就世界模范', '', '/wxadmin/upload/article/150413160004VEKTHTH.plain', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">&nbsp; 膜事业是长塑事业的起点，也是重点。长塑在已有资源、技术与规模优势的基础上，通过产品创新和经营领先策略，不断整合资源和创新技术，不断丰富膜产品的系列及品类，拓展膜产品的应用及推广，使长塑膜成为人类健康安全生活的卫士，使长塑成为中国膜领域的风向标，世界膜领域的领航者。</span></p>\"}', null, '', '0', '0', '20150413160156', '0'), ('417', '233', '热封尼龙膜', '', '/wxadmin/upload/article/150414165435BZNAUTS.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">可热封双向拉伸尼龙薄膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;可热封尼龙薄膜适用于冷鲜食品包装、电子包装、气球等。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15~25um 宽度300~1600mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度4000/6000/8000/12000m。</p><p><br/></p>\"}', null, '', '0', '0', '20150414123524', '1'), ('416', '233', '超高爽滑尼龙膜', '', '/wxadmin/upload/article/150414165346PVJZCAM.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">超高爽滑双向拉伸尼龙薄膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;超高爽滑尼龙膜适用于锂电池及药包的冷压深冲，自动化包装及自动化填充等。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15~25um 宽度300~1600mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度4000/6000/8000/12000m。</p><p><br/></p>\"}', null, '', '1', '0', '20150414123502', '1'), ('345', '222', '速以制胜 恒以致远', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 速以制胜。长塑以膜事业为起点，速育才、速创新、速周转、速覆盖、速扩张，实现了跨越式发展；&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 恒以致远。长塑立足绿色生活材料领域，恒拼搏、恒创新、恒专注、恒汲取、恒突破，努力实现基业长青。</span></p>\"}', null, '', '0', '0', '20150413160820', '0'), ('346', '222', '担当 拼搏 创造 成长', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 担当：用百分百的敬业度，人人争当敬业乐群的长塑主人；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 拼搏：用百分百的激情度，人人争当拼搏进取的长塑拓疆者；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 创造：用百分百的智慧力，人人争当效能创造的长塑主力军；</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 成长：用百分百的汲取力，人人争当基业长青的长塑捍卫者。</span></p>\"}', null, '', '0', '0', '20150413160901', '0'), ('347', '222', '环境与健康安全方针：关注健康安全，关注环境友好，关注资源节约', '', '', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 关注健康安全：长塑为客户提供健康安全的产品，并以此作为消费者健康安全生活的卫士；我们重视生产经营的全业务链上的健 康安全管控，追求零污染；并重视为员工提供健康、安全、舒适的工作生活环境；&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 关注环境友好：长塑坚信良好的环境是我们赖以生存和发展的空间，我们不以牺牲环境为代价获取企业发展，为此，我们遵守环境法规，我们重视环境保护，我们拒绝环境污染，并持续改进，努力使我们的产品在废弃时可降解或可再生；&nbsp;</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px; white-space: normal;\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 24px;\\\">• 关注资源节约：长塑坚信资源是我们赖以生存和发展的基石，资源是会枯竭的，我们重视资源保护和 再利用，提高资源利用水平、利用率和节能减排，并努力使资源价值最大化。</span></p>\"}', null, '', '0', '0', '20150413161023', '0'), ('401', '239', 'BOPA薄膜的使用注意事项', '', '/wxadmin/upload/article/150414151428ONIRUUJ.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">BOPA薄膜的使用注意事项</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">　　尼龙薄膜是一种极易吸潮的产品，吸潮后将对使用造成不利影响，如尺寸变化导致印刷时套印不准，表面的水膜导致复合强度不足、起泡等，因而在高湿度环境下要对尼龙薄膜做好防潮保护。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">具体要注意以下几方面问题：</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">（1）使用前不要过早打开包装。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">（2）尽量一次用完，剩下的余膜用阻隔性好的材料包好。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">（3）印刷时第一色组不上版辊印刷，进行预干燥。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">（4）使用前放入熟化室干燥2-3小时。</span><br style=\\\"margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; white-space: normal; background-color: rgb(255, 255, 255);\\\"/><span style=\\\"color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);\\\">（5）保证生产车间合理的温度（25℃±2℃）和湿度（≤85%RH）。</span></p>\"}', null, 'BOPA薄膜的使用注意事项\n　　尼龙薄膜是一种极易吸潮的产品', '0', '0', '20150414122432', '0'), ('412', '240', '长塑之速第九期', '', '/wxadmin/upload/article/150414150307RZKTZED.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(119, 119, 119); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 22px;\\\">长塑以膜事业为起点，筚路蓝缕，披荆斩棘，短短数年间，以速制胜，以恒致远，从无到有，从有到大，从大到强，成就世界膜范。长塑重视永续经营；长塑注重企业与人、自然、社会的和谐共处。</span></p>\"}', null, '长塑以膜事业为起点，筚路蓝缕，披荆斩棘，短短数年间，以速制胜', '4', '0', '20150414123044', '0'), ('406', '233', '分步拉伸尼龙膜', '', '/wxadmin/upload/article/150414165102COUXLKQ.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">双向拉伸复合型尼龙薄膜、双向拉伸印刷复合型尼龙薄膜、双向拉伸均衡型尼龙薄膜…<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;复合型适用于常规用途、简单印刷包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;印刷复合型适用于普通印刷、复合制袋工艺。<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;均衡型适合于高档印刷、复合制袋工艺。<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15um 宽度300~1500mm<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度6000/12000/18000m。</p><p><br/></p>\"}', null, '', '0', '0', '20150414122600', '0'), ('415', '233', '消光型尼龙膜', '', '/wxadmin/upload/article/150414165327XRRHTXU.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">消光型双向拉伸尼龙薄膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;消光型尼龙膜适用于精美印刷包装及高档书籍封面。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度12~15um 宽度300~1600mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度6000/7500/12000/15000m。</p><p><br/></p>\"}', null, '', '0', '0', '20150414123438', '0'), ('407', '240', '长塑之速第八期', '', '/wxadmin/upload/article/150414150432RHSDJMJ.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(119, 119, 119); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 22px;\\\">企业文化对员工的凝聚、约束、激励作用将会使企业获得竞争的主动权和致胜力量。长塑向世界级优秀企业发展需要强有力的文化支撑，为了实现文化接地气，长塑结合目前全新发展战略进行了</span></p>\"}', null, '企业文化对员工的凝聚、约束、激励作用将会使企业获得竞争的主动', '0', '0', '20150414122602', '0'), ('408', '233', '同步拉伸尼龙膜', '', '/wxadmin/upload/article/150414165126WWBLZMI.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">机械式同步拉伸尼龙薄膜、磁驱动线性同步拉伸尼龙薄膜 ……<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;适用于高温蒸煮包装、高速精美印刷包装。<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15um 宽度300~1500mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度6000m。</p><p><br/></p>\"}', null, '', '0', '0', '20150414122620', '0'), ('409', '233', '高阻隔型尼龙膜', '', '/wxadmin/upload/article/150414165151NZPKIBB.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">M高阻隔型尼龙薄膜、EVOH高阻隔型尼龙薄膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;M高阻隔型尼龙薄膜适用于保鲜、保香、保质期长、耐高温的食品包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;EVOH高阻隔型尼龙薄膜适用于冷鲜食品及饮料、化学品及电子军工品等包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15um 宽度300~1500mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度6000/12000/18000m。</p><p><br/></p>\"}', null, '', '0', '0', '20150414122647', '0'), ('410', '233', '超薄型尼龙膜', '', '/wxadmin/upload/article/150414165213SBKWOTP.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">节能型尼龙薄膜、超薄型尼龙薄膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;节能型尼龙薄膜适用于常规包装，降低综合成本。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度12um 宽度300~1600mm<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度7500/15000m。<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;超薄型尼龙薄膜适用于气球等超薄包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度≦10um 宽度300~1600mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度9000m。</p><p><br/></p>\"}', null, '', '0', '0', '20150414122715', '0'), ('411', '233', '增强型尼龙膜', '', '/wxadmin/upload/article/150414165230EAPCWGK.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">增强型尼龙膜、超强型尼龙膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">• &nbsp;&nbsp;&nbsp;&nbsp;增强型尼龙膜适用于泡罩药包、粽子袋等包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15~25um 宽度300~1600mm<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度4000/8000m。<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;超强型尼龙膜适用于泡罩药包、锂电池等包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度25~30um 宽度300~1600mm<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度4000/8000m。</p><p><br/></p>\"}', null, '', '1', '0', '20150414122805', '1'), ('413', '240', '长塑之速第六期', '', '/wxadmin/upload/article/150414150523EOQWBIZ.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(119, 119, 119); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 22px;\\\">《少年派》《阿凡达》和《盔梦空间》这三部电影，引发了中国电影市场海啸般的狂潮与震撼。 他们带来人性和宗族思索、电影3d技术和文化翅象力上的一次启蒙．而，苹果凭借着创 新操作方法</span></p>\"}', null, '《少年派》《阿凡达》和《盔梦空间》这三部电影，引发了中国电影', '0', '0', '20150414123055', '0'), ('414', '240', '长塑之速第七期', '', '/wxadmin/upload/article/150414150512AHTOAOR.jpeg', '{\"content\":\"<p><span style=\\\"color: rgb(119, 119, 119); font-family: Arial, 微软雅黑; font-size: 12px; line-height: 22px;\\\">人的欲望是无限的，就一项经济活动而言，最重要的事情当然是最好的利用其有限的资源，所以，效率在企业中成为关键性的概念，接好号令并高效率地执行也成为企业对员工的重要考量标准</span></p>\"}', null, '人的欲望是无限的，就一项经济活动而言，最重要的事情当然是最好', '1', '0', '20150414123107', '0'), ('418', '233', '易粘结型尼龙膜', '', '/wxadmin/upload/article/150414170919BNTIJKF.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\">易粘结型双向拉伸尼龙薄膜<br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/><br style=\\\"margin: 0px; padding: 0px;\\\"/></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(130, 130, 130); font-family: 微软雅黑; line-height: 26px; white-space: normal;\\\"><br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;易粘结型尼龙膜适用于精美印刷及复合，镀铝，液体包装。&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;规格：厚度15~25um 宽度300~1600mm&nbsp;<br style=\\\"margin: 0px; padding: 0px;\\\"/>• &nbsp;&nbsp;&nbsp;&nbsp;长度4000/6000/8000/12000m。</p><p><br/></p>\"}', null, '', '2', '0', '20150414123544', '1'), ('442', '274', '123', '123', '', '{\"content\":\"<p>123</p>\"}', null, '123', '3', '0', '20150424220812', '0'), ('434', '270', '2344444', '2343', '/wxadmin/upload/article/150514170140WECTEGX.jpeg', '{\"videoName\":\"视频名称1\",\"videoUrl\":\"视频地址2\"}', null, '2341', '2', '0', '20150416162211', '0'), ('435', '270', '2344555555', '234', '/wxadmin/upload/150424231216QJUIPMX.jpeg', '{\"videoName\":\"234\",\"videoUrl\":\"234\"}', null, '234额', '0', '0', '20150416162353', '0'), ('436', '270', '234让人', '234', '/wxadmin/upload/150424231237JPFENNA.jpeg', '{\"videoName\":\"234\",\"videoUrl\":\"234\"}', null, '234', '3', '0', '20150416162418', '0'), ('437', '269', '234werwer3333', '234', '/wxadmin/upload/article/150514170214