d/article/150514184638DJSLUIM.jpeg\",\"imgDesc\":\"\"},{\"imgUrl\":\"/wxadmin/upload/article/150514184642FVVJDWV.jpeg\"}]}', null, '3', '0', '0', '20150514184645', '0'), ('456', '282', '4', '4', '', '{\"imgs\":[{\"imgUrl\":\"/wxadmin/upload/article/150514184702OAAYAFD.jpeg\",\"imgDesc\":\"\"},{\"imgUrl\":\"/wxadmin/upload/article/150514184705VMUCYTZ.jpeg\"}]}', null, '4', '0', '0', '20150514184707', '0'), ('457', '282', '5', '5', '', '{\"imgs\":[{\"imgUrl\":\"/wxadmin/upload/article/150514184727JWLKNHN.jpeg\",\"imgDesc\":\"\"},{\"imgUrl\":\"/wxadmin/upload/article/150514184731UMOJCII.jpeg\"}]}', null, '5', '0', '0', '20150514184903', '0'), ('458', '270', '1', '1', '', '{}', null, '1', '0', '0', '20150515124049', '0'), ('459', '287', '微博测试', '微博测试', '/wxadmin/upload/article/150515144300WBEBZSQ.jpeg', '{\"weiboName\":\"微博测试\",\"weibo\":\"werwrqwrwq\",\"weiboLogo\":\"/wxadmin/upload/article/150515144940YWEJSDJ.jpeg\"}', null, '微博测试', '4', '0', '20150515133501', '0'), ('460', '292', '222', '2222', '/wxadmin/upload/article/150515145050CMKOJXQ.jpeg', '{\"imgs\":[{\"imgUrl\":\"/wxadmin/upload/article/150515135142GRSICDT.jpeg\",\"imgDesc\":\"22222\"},{\"imgUrl\":\"/wxadmin/upload/article/150515135145OZLJHDB.jpeg\",\"imgDesc\":\"2222222\"}]}', null, '22222', '13', '0', '20150515135157', '0'), ('404', '239', '“梅雨”季节使用尼龙膜印复注意事项', '', '/wxadmin/upload/article/150414151412PSBCHLP.jpeg', '{\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">过了春节，南方气侯逐渐转暖并将进入“梅雨”季节，同时“梅雨”季节也逐渐向北扩展。而今年的雨季似乎来得特别早，并且雨水比往年多。在这种高温多雨的季节，对于尼龙膜的生产和使用就要特别注意，以免因空气中的湿度过大，尼龙膜吸湿而引起印刷、复合工艺上的各种不必要的失误而引发印复产品质量问题。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">尼龙膜虽然是极性材料，在生产过程中有经过分子结晶这个过程</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">但并非所有聚酰胺中的分子都能结晶的</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">还有一部分非结晶的酰胺基极性基团</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">这些酰胺基可以与水分子配位</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">导致尼龙薄膜表面极易吸入极性很强的水分子</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">使尼龙膜吸潮变软，拉伸力减弱，生产时产生张力不稳，有时在薄膜表面形成一层薄薄的水膜</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">阻隔油墨和胶粘剂对薄膜的附着，而影响产品质量。</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">如使印品起皱、套印不准，制袋错位、翘边、卷曲，复合膜起泡、容易起斑点、晶点和白点。异味增多、膜面粘连、打码困难、等等。严重时引发复合剥离强度下降或产生油墨或胶粘剂转移、降解而脱层、打码速度下降或打码打不上高温蒸煮过程中破袋现象增多、复合膜手感发硬、发脆现象增多等。这些都是尼龙膜吸潮以后产生的缺点而造成的质量故障。因此，在“梅雨”季节使用尼龙膜生产就应该特别的注意天气的变化和生产车间温湿度的控制，以防由于湿度大引起各种不良质量因素的产生。以下提出几点注意事项以供在日常生产过程参考：</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">1、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">严格控制生产环境的温湿度</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">由于尼龙膜的吸潮性以及吸潮后所引起的一系列不良质量后果，因此对尼龙膜的使用环境和存放环境十分重要。一般应存放在</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">2</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">3</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">℃、±3℃左右，干湿差在50% ±5% 范围内比较理想，尼龙膜不能直接放置于地板、露天，以免受潮吸湿。而生产环境的干湿差一般不超过80%，若达80%应停止生产以免产生不良因素。可在生产场地加放排风扇和除湿机，加强室内空气流通，有的企业将生产尼龙材料安排在中午时间段。总之，在湿度超过70%时一定慎重使用，在气温偏低或湿度偏大时使用，一定要开启印刷和复合机的预热设备，先将尼龙膜预热，烘干附于尼龙膜表面的水份。厦门长塑实业公司在生产过程中虽有恒温恒湿控制，但在运输和使用中，可能会产生许多不可预见的因素，需特别注意生产环境的温湿度变化，以利于生产的顺利进行。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">2、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">尽量少用或不用醇类溶剂</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">印刷尼龙薄膜有其专用的聚氨酯树脂类油墨，在使用聚氨酯树脂类油墨时注意少加或不加醇类稀释溶剂。因为聚氨酯树脂本身是由-OH封端的，-OH能与聚氨酯胶粘剂的固化剂中的异氰酸酯基-NCO发生反应，使固化剂参与胶粘剂主剂反应的量减少，影响粘合强度。如若一定要加入醇类稀释溶剂，也应尽量控制在8%以内，并在印刷过程中将溶剂残留量降至最小限度（一般总量＞3mg/m<sup style=\\\"margin: 0px; padding: 0px;\\\">2</sup>），在印刷有白墨打底的印件时,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">最好在白墨中加入少量的固化剂以提高复合牢度。(根据油墨厂家按要求加入量使用)</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">印后应尽快进行复合生产,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">剩余材料可用含有铝箔的包装膜包装好</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">以防空气中水蒸气侵入受潮</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">剩膜应放置于干燥通风处</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">再用时最好提前</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">2~3</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">小时放置于熟化室以烘干尼龙膜表面水蒸气</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">使材料免于受潮而影响产品质量。如果生产水煮蒸煮袋，油墨一定加入固化剂以保证油墨附着率。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">3、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">注意油墨的质量，以防色迁移和色渗透</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">“梅雨”季节或高温高湿的天气中使用</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">BOPA</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">薄膜应防止塑料凹印中出现的色迁移和色渗透。色迁移和色渗透主要是由于墨层中颜料的小分子在一定的湿度和温度下做剧烈的布朗运动</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">从而脱离靠微弱的分子间力形成的晶格而跟随其它有机分子一起做迁移运动，散布颜色。在高湿高温的环境中，色淀颜料如青莲色、桃红色等很容易产生色迁移，特别是印刷好的成品，堆放一定要注意。温度越高，湿度越大，水分子就越多，颜色料晶体的分解受水的作用就越严重，色渗透也就越容易产生。而对于单听偶氮颜料来说，由于分子量小，所以比较容易发生迁移；对于双偶氮颜籵及缩合偶氮颜料如联苯胺黄、颜料红</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">44</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">等由于大大提高了分子量，所以不易发生迁移。杂环颜料，如永固紫由于分子量大，化学性质稳定，因而也不容易发生迀移。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">色渗透发生机理比色迁移复杂，除与颜料本身的特性如分子量、受水作用影响程度有关外，还与薄膜的特性有关。色迀移与色渗透发生的原因一般是墨层中的颜料、温度、湿度、薄膜本身特性等方面共同作用的结果。对于尼龙膜、非线型聚乙烯等薄膜，由于是无定型态，结晶程度低，分子间隙大，在高温高湿环境下易发生色渗透现象。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">4、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">真溶剂和假溶剂的添加控制</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">在印刷油墨中加入的混合溶剂中，有的溶剂可以溶解油墨中的连结料，称之为真溶剂，有的溶剂单一使用则不能溶解油墨中的连结料，称为假溶剂。由于溶剂之间挥发性不同，如果真溶剂先挥发，则油墨中溶剂的比例受到破坏就会出现油墨树脂析出沉淀等现象。所以应及时补加真溶剂，当溶剂平衡性较差时，应添加一些蒸发速度较慢的真溶剂。以保持溶剂挥发性的平衡。各种类型的油墨由于油墨树脂的不同，针对使用的真溶剂也不同，一定要先搞清楚使用哪种类型的树脂油墨，才能对应使用何种真溶剂。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">5、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">溶剂的质量也非常重要</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">必须对所使用的溶剂的含水、醇量进行控制。各种溶剂的质量非常重要，如醋酸乙酯的含水量、含醇量多少完全可以影响到干式复合产品的质量。在国家标准</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">GB3728--1991</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">中有规定。优等品醋酸乙酯含量应达</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">99.0%</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">，水分含量</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">0.1%</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">、一等品醋酸乙酯含量应达</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">98.5%</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">水分含量为</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">0.20%</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">以内。在干式复合中水分含量不超过</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">0.20%</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">才能符合要求，并且不能含醇、胺、活性氢类，否则将消耗固化剂，出现复合剥离牢度差、不干、复合脱层或起皱等现象。这是由于带</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">-OH</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">封端的聚氨酯主剂与带</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">-NCO</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">封端的聚氨酯固化剂发生反应生成较大分子量的聚氨酯而形成粘合力。因此，它们之间的配位是有固定的配比，而带有</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">-OH</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">的醇类物质及带有</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">-NH<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub></span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">的物质对复合加工的干扰性较大，不但会产生大量的不干现象，同时残留溶剂多，复合产生气泡等质量问题也会不断涌现。为了保证在高湿天气下复合胶粘剂主剂和固化剂的匹配合理，考虑空气中湿度大的同时，在配制胶粘剂时，可适当增加</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">5%~8%</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">的固化剂用量，以保证胶粘剂的正常交联固化。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">6、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">由于湿度大引起的凝胶和白化。</span></strong></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">由于水份带入到含有异氰酸酯基（</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">--NCO</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">）的粘合剂系统中</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">会引起凝胶和白化。这主要是</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">:1</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">摩尔的水</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">(H<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub>O)</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">可以和</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">1</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">摩尔的含有异氰酸酯基</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">(-NCO)</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">的粘合剂的固化剂反应生成胺和二氧化碳</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">&nbsp;<strong style=\\\"margin: 0px; padding: 0px;\\\">R-NCO+H<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub>O</strong></span><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">→</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">R- NH<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub>+C</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">O<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub></span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">↑</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">这一步反应虽然不是很快,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">但比起与主剂的反应要快得多。（有人做过试验快10倍以上）。由于固化剂与水反应在先,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">从而改变了主剂与固化剂的配比,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">使粘合剂不能正常固化,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">而与水生成的</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">CO<sub style=\\\"margin: 0px; padding: 0px;\\\">2</sub></span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">气体在复合制品鼓胀</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">造成气泡和针孔</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">而与水反应产生的胺继续与</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">1</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">摩尔的含异氰酸酯基</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">(-NCO)&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">反应</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">生成缩二脲</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;<strong style=\\\"margin: 0px; padding: 0px;\\\">R-NCO+R<sup style=\\\"margin: 0px; padding: 0px;\\\">2</sup>--NH</strong></span><strong style=\\\"margin: 0px; padding: 0px;\\\"><sub style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 16pt;\\\">2</span></sub></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><sub style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">--</span></sub></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">RNHCONH</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">R</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">↓</span></strong><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">。该产品是一种白色结晶,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">不溶于醋酸乙酯中而呈现胶液的白化,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">生成的缩二脲逐渐积累,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">使复合花辊堵塞而造成上胶量不足,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">产生废品。经常在早上复合胶液还正常使用，到下午就出现胶液混浊变白并有沉淀现象就是这个原理。因此在配制粘合剂时，随配随用，不要放置时间过长，在配制时保证固化剂量，使其尽量往上限靠，一股不超过正常用量的15%(应视实际情况调节)。因此，在这段季节印刷复合使用尼龙膜是个难关，特别对复合工序更为重要。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\">&nbsp;</strong></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">7、</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">做好熟化工作。</span></strong></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">对于印刷复合好的半成品的熟化工作非常重要，是关系到印复质量好坏的关健，熟化目的是让胶粘剂进一步交联，若完全交联，分子排列整齐就可以提高复合牢度。另一方面可以将半成品复合膜中的残留溶剂排出以减少残留溶剂量,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">从而减少剥离强度不良,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">开口性差</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">有异味等等。（使用高阻隔性材料，如</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">PET</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">、</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">BOPA</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">等材料要将残留溶剂在熟化过程中排出就较因难，一定要在印刷和复合烘干中尽量排除，以减少溶剂残留产生的不良后果）。熟化无论采用外加热或内加热</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">都以达到固化室内温度稳定、均匀为目的。一般可按要求时间进行熟化，如若固化时间过短，可能导致胶粘剂固化不完全，而影响剥离强度和残留异味，而固化时间过长，则可能导致薄膜开口性不良。从试验的结果看，两层或蒸煮的薄膜需要低温长时间固化，而镀铝膜复合则需要提高固化温度，减少固化时间来降低脱铝的机率，而高温蒸煮袋一般需要</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">50~5</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">5</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">℃、72h的固化才能满足固化要求。业内有人提出二次熟化的工艺，即:</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">将多层基材复合好后,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">先放于</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">5</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">0</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">℃的烘房里熟化36h,</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">然后取出分切和制袋。再将分卷好的半成品和制袋好的成品放在70℃下保持12h(PE为内膜)</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">或在90℃下保持3h(CPP为内膜)</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">进行短时间的二次熟化（特殊熟化工艺）</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">其熟化效果比一次性长时间熟化效果更好。在有铝箔和真空镀铝的产品中也有先将复合铝箔和镀铝的半成品先熟化</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">24h</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">而后再复合热封层后再熟化</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">24h,&nbsp;</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">以提高复合剥离牢固。以上方法在大批量使用前请先做好实验取得一定参数认为可行再使用。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\">&nbsp;</strong></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">8</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">、擦掉附着小水珠。</span></strong></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">在高湿高温季节里，复合机上胶辊和印刷机拦墨刀上很容易吸附空气中的小水珠，一旦时间久，小水珠越积越多就可能跑进油墨或胶粘剂中，产生一系列的质量问题。因此，在此季节内若发现拦墨刀上和导辊、网辊上有水珠出现，则应立即用干净的布或干毛巾，将水珠擦掉，以防万一。并且可以在室内放置排风扇，加强室内空气流通，但注意不要对着复合、印刷机吹，特别是印刷版辊和复合上胶花辊。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">9</span></strong><strong style=\\\"margin: 0px; padding: 0px;\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">、改变复合机工艺，使烘干箱内的出风速度大于进风速度。</span></strong></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">一般国内大多数复合机出风口较小，复合时进风速度比出风速度大，使烘道内形成高气压，易使膜内溶剂残留。进口复合机一般在出风管路口安装引风机，使出风口风速大于进风口风速，使烘道内形成低气压，宜于溶剂挥发，减少残留溶剂。此外烘干箱内的温度可调高尽量调髙。</span></p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\">&nbsp;</p><p style=\\\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 12px; color: rgb(102, 102, 102); font-family: Arial, 微软雅黑; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">总之</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">,</span>&nbsp;<span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">在“梅雨”季节和高温高湿环境中，对尼龙膜的使用一定要加倍注意，防止其吸湿变形而产生的一系列不必要的，本来可以避免的产品质量事故的产生。在实际生产中，各生产企业应根据自身的生产环境和设备状况进行有效的调节和安排。对生产中出现的质量问题进行细致认真的分析、排查，找出问题的原因所在，找出最佳解决问题的方案及改进方法，在实际生产中不断总结经验，不断提高自身的业务水平，在“梅雨”季节来临之际，充分做好思想上的准备，以应对“梅雨”季节对使用尼龙膜带来的不利影响。同时，厦门长塑公司研发中心也在不断的寻找和开发新的吸湿性小的尼龙膜产品，与使用厂家一起，共渡高湿高温天气带来的困难。</span><span style=\\\"margin: 0px; padding: 0px; font-size: 12pt;\\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p><p><br/></p>\"}', null, '过了春节，南方气侯逐渐转暖并将进入“梅雨”季节，同时“梅雨”', '1', '0', '20150414122522', '0');
COMMIT;

