  `is_leaf` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否是叶，叶子才可以有文章',
  `cct` int(11) DEFAULT NULL,
  PRIMARY KEY (`cat_id`),
  KEY `parent_id` (`parent_id`),
  KEY `level` (`level`)
) ENGINE=MyISAM AUTO_INCREMENT=299 DEFAULT CHARSET=utf8;

