-- ----------------------------
DROP TABLE IF EXISTS `gd_article_images`;
CREATE TABLE `gd_article_images` (
  `imgId` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `articleId` int(11) unsigned NOT NULL DEFAULT '0',
  `img_url` varchar(255) NOT NULL DEFAULT '',
  `img_desc` varchar(255) NOT NULL DEFAULT '',
  `thumb_url` varchar(255) NOT NULL DEFAULT '',
  `sort_order` smallint(3) unsigned NOT NULL DEFAULT '1' COMMENT '图片顺序',
  PRIMARY KEY (`imgId`),
  KEY `articleId` (`articleId`)
) ENGINE=MyISAM AUTO_INCREMENT=960821 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `gd_article_images`
-- ----------------------------
BEGIN;
INSERT INTO `gd_article_images` VALUES ('10', '22', 'shop/20150123155842408//20150123155842_RwKH.jpg', '炖鸡', '', '1'), ('2', '4', 'shop/20150122225200270//20150122225200_ctMs.jpg', '简单描述', '', '1'), ('960777', '1', 'shop/20150128181237319//20150128181237_qILC.png', '一铲铲的煤铲进背箩，越来越沉，双手需要托着背箩，只能任凭汗水在脸上的肆意流淌。', '', '1'), ('959910', '1', 'shop/20150128174255972//20150128174255_QOQZ.jpg', '云南省镇雄县是国家级扶持特困县,在那里有一个靠背背箩谋生的特殊行业。他们大多来自镇雄县偏远贫困的山区，年龄最大的超过60岁，最小的不到20岁，背背箩时间最长的超过20年，他们长年累月游荡在县城的大街小巷，各个角落，累了席地而坐，渴了找个自来水猛灌几口。', '', '1'), ('960782', '1', 'shop/20150128181439881//20150128181439_JpXw.png', '街边上，到处都有背箩们的身影。', '', '1'), ('960781', '1', 'shop/20150128181421148//20150128181421_zPYc.png', '街面上、公路旁、墙角边到处都有背箩们的身影，他们或坐、或站、或靠，甚至有的直接躺在墙角边，喧嚣的城市好像与他们无关；他们大多衣衫破屡，汗气熏人，蓬头垢面，尘满面，鬓如霜，用低廉的劳力换取两口饭钱。', '', '1'), ('6', '16', 'shop/20150123152720810//20150123152720_lnYr.jpg', '大山包的最佳旅行时间是秋冬季，8月初至10月初，山上的荞花、燕麦、芳草地成块成片，层层叠叠，色彩斑斓，把苍凉的大山包点缀成一个世外桃源般的梦幻世界。此时的大山包，可以称得上是摄影者的乐园，常可以看到专业摄影师扛着设备四处选景。在大山包的跳墩河水库、大海子水库两个地方可看到成群结队的黑颈鹤在湖边觅食、栖息。 冬季，到大山包去看黑颈鹤。', '', '1'), ('7', '17', 'shop/20150123153154660//20150123153154_RLDq.jpg', '西部大峡谷是国家AAAA级旅游景区，位于云南省昭通市水富县，金沙江流经该地区，沿江两岸山崖险峻，草木葱翠,。', '', '1'), ('8', '17', 'shop/20150123153229881//20150123153229_ZDez.jpg', '西部大峡谷是国家AAAA级旅游景区，位于云南省昭通市水富县，金沙江流经该地区，沿江两岸山崖险峻，草木葱翠,。', '', '1'), ('9', '21', 'shop/20150123155307217//20150123155307_LKVJ.jpg', '烧烤也是当地美食之一', '', '1'), ('12', '25', 'shop/20150123163438016//20150123163438_Tann.jpg', '风景', '', '1'), ('13', '25', 'shop/20150123163504738//20150123163504_LpJK.jpg', '风景', '', '1'), ('14', '25', 'shop/20150123163531308//20150123163531_fxdc.jpg', '风景', '', '1'), ('16', '26', 'shop/20150123164114914//20150123164114_UzSM.jpg', '美食2', '', '1'), ('15', '26', 'shop/20150123164135780//20150123164135_swfH.jpg', '美食3', '', '1'), ('17', '27', 'shop/20150123165203859//20150123165203_ILQw.jpg', '文化2', '', '1'), ('18', '27', 'shop/20150123165230896//20150123165230_pklA.jpg', '文化3', '', '1'), ('19', '28', 'shop/20150123170230616//20150123170230_WNGt.jpg', '传统1', '', '1'), ('20', '28', 'shop/20150123170335241//20150123170335_ysHG.jpg', '传统2', '', '1'), ('959912', '1', 'shop/20150128172916103//20150128172916_bgfd.jpg', '一拖拉机煤有2吨半，每铲5公斤，铲完一车煤，需要挥动煤铲至少500铲。', '', '1'), ('26', '27', 'shop/20150123200738285//20150123200738_PLPN.jpg', '文化4', '', '1'), ('28', '38', 'shop/20150123212513261//20150123212513_xFlD.jpg', '在学校中，她一直是个说话声音很小的女孩。一次音乐课上，她大声地唱了一首羌族民歌，受到了老师的夸奖，“这是我人生中第一次感到了前所未有的自信，甚至第一次用如此大的分贝发出声音。”', '', '1'), ('29', '38', 'shop/20150123212606198//20150123212606_TIpk.jpg', '3年前的一天，阿依在朋友的鼓动下进商场买了高跟鞋，“周围试鞋女孩们看我的样子，是好奇、同情，但绝对没有轻蔑。”而后，她又有了很多的第一次，第一次走进健身房练瑜伽，第一次打羽毛球……', '', '1'), ('30', '39', 'shop/20150123215138488//20150123215138_fiSe.jpg', '邹若衡军旅生涯结束后，寓居昆明。龙云主滇时期，任命邹若衡为河口督办、云南造币厂厂长等职。建国后，邹若衡服务于云南文史馆，将生平所习武术传授于子孙后辈。家族里主要传其侄子邹锡彪，邹锡彪又传给长子邹长初和外姓弟子许明富', '', '1'), ('31', '39', 'shop/20150123215233235//20150123215233_zXTU.jpg', '彭勤家以卖豆花为生，生活十分清苦，但他仍不忘施济穷人。而如果是官员来买豆花，他说多少钱就是多少钱，绝不给讨价还价的余地。他因此被称为“义侠”。', '', '1'), ('34', '23', 'shop/20150126115457720//20150126115457_fKwZ.jpg', '测试1', '', '1'), ('36', '65', 'shop/201501/36/20150128183954_UPkU.jpg', '123', '', '1'), ('37', '65', 'shop/20150127215235948//20150127215235_kmwU.jpg', '2', '', '1'), ('38', '65', 'shop/20150127215301118//20150127215301_LxtE.jpg', '3', '', '1'), ('959911', '1', 'shop/20150128172721908//20150128172721_gfXd.jpg', '2012年7月的一天，经过深思熟虑，我毅然背起了背箩，真正走进了背箩人的生活，深切体会到了背箩人的无奈与辛酸。那天，接的第一个活儿就是背煤。早餐后没一会儿，活路找上门，跟随姓龚的大哥和蔡大爷背了一车煤，两吨半煤，爬二楼，龚大哥和雇主谈好价钱，我们三个人花了将近2个小时，每人分得20元，老板人还算不错，看我们干得辛苦，另外给了我们每个人2瓶牛奶。', '', '1'), ('960780', '1', 'shop/20150128181406431//20150128181406_IjbW.png', '背完一车煤，我早已是筋疲力尽，脸早已被汗水与煤渣糊得面无全非，手掌在早上背第一车煤就打起的血泡越来越大，越来越痛，肩膀被背箩勒出的血印越来越深。', '', '1'), ('960778', '1', 'shop/20150128181335548//20150128181335_ifER.png', '被煤砸过的痕迹清晰可见，他们说要装满才能走。', '', '1'), ('960779', '1', 'shop/20150128181351539//20150128181351_DIOR.png', '一车煤背完，早已煤头灰面了。当一铲铲黑漆漆的煤装在背箩里，当肩上的背箩越来越沉重，当又咸又涩的汗水流入眼眶、淌进嘴角，什么理想，什么抱负，人世间什么恩怨情仇，全都抛到了九霄云外，大脑一片空白，只想把煤背完，把背箩扔掉，然后随便找个地方躺倒安逸的睡个觉。', '', '1'), ('960783', '1', 'shop/20150128181455715//20150128181455_imsl.png', '为了便宜，他们通常选择一些比较偏僻的、极其简陋的地方。', '', '1'), ('960784', '1', 'shop/20150128181510723//20150128181510_FEZq.png', '图片所摄位置是在一家私人楼房顶上，通往房顶只有一架破旧的木梯，每天晚上每张床，费用2元。大概住了有6、7个人。', '', '1'), ('960785', '1', 'shop/20150128181528237//20150128181528_YjxO.png', '盛夏的镇雄，火辣辣的太阳烤得人头晕脑胀。中午一点多钟，我们每个人刚吃过一个糯米粑粑，又有雇主来找人背煤，我跟一姓罗的大哥、姓支的大哥和另一名大哥共4人前往，雇主说要背煤，一拖拉机两吨半，来到目的地，几位大哥看过地势后，又开始讨价还价，我们要90元一车，雇主也懂行情，只给60元一车，多一分也不给，没撤。', '', '1'), ('960786', '1', 'shop/20150128181550718//20150128181550_tPMq.png', '实在太大块，铲不动的时候，只好用手搬。', '', '1'), ('960787', '1', 'shop/20150128181605191//20150128181605_lTJt.png', '一块煤从背箩里掉出来，砸在我的脖子上，痛且冰凉。', '', '1'), ('960788', '1', 'shop/20150128181617564//20150128181617_EjUD.png', '背完了两车煤，被背箩背带勒出的血印，衣服碰着都会疼。', '', '1'), ('960789', '1', 'shop/20150128181632921//20150128181632_YDHS.png', ' 今天的运气真的很好，听他们说，平时都没什么活路，大部分时间都在瞎转悠，一天到晚一分钱不挣的情况时常都有。今天总共背了四车煤，重量超过10000斤，总共挣了65块钱。', '', '1'), ('960790', '1', 'shop/20150128181648366//20150128181648_NMTx.png', '当背完最后一背煤时，天已经黑了。城市的灯光五彩斑斓，夏日丰富多彩的夜生活已悄然上演，而背箩人似乎还没有停歇的意思，他们依旧背起硕大的背箩，游荡在城市的大街小巷，争取为明天多挣两个馒头钱。', '', '1'), ('960791', '93', 'shop/20150129094011437//20150129094011_RLKL.png', '阿娇全名叫何忠娇，今年10岁，是云南省彝良县奎香镇新房小学三年级学生。因为家里太穷，阿娇5岁那年，妈妈丢下了阿娇姐妹俩离家出走，就再也没有回来。彝良“9.7”地震后，原来的学校成了危房，被拆除重建。对于阿娇来说，幸福很简单，或许仅仅就是拥有一个完整温暖的家，只是一个新作业本，一顿能吃饱的饭菜。', '', '1'), ('960792', '93', 'shop/20150129094045075//20150129094045_tTjd.png', '阿娇家所在的彝良县奎香乡是红色革命老区，1936年3月，长征途中的贺龙、任弼时、萧克等老前辈，曾在她家附近的山里酝酿、指挥了著名的“乌蒙回旋战”。', '', '1'), ('960793', '93', 'shop/20150129094113790//20150129094113_ZaGr.png', '前些天，爸爸又外出做工，已经好几天没回家了。7月10日清晨，阿娇和往常一样早早起床，与姐姐分了工，阿娇负责打扫房前屋后卫生、煮饭，姐姐则去打猪草、喂猪。姐姐阿丽15岁了，前几天刚刚考完小升初考试。因为患病，姐姐总在担心，能不能继续就读初中。', '', '1'), ('960794', '93', 'shop/20150129094139598//20150129094139_MIyC.png', '早饭依旧是面条。面条常常成为姊妹俩的主食，好在几天前爸爸出门时炒的青椒腊肉还有些，多少有些油荤。', '', '1'), ('960795', '93', 'shop/20150129094202809//20150129094202_bRcx.png', '在这个家里，姊妹俩除了要照顾好自己、家里的几头猪，以及其他家务需要做之外，80多岁的爷爷还需要幼小的她们照顾。爷爷原本是和叔叔家一起生活的，叔叔婶婶也外出打工很久了，只有身体不好、年岁已高的爷爷独自留守在家，行动不便，生活难以自理。懂事的姐妹俩总是先给爷爷送去吃的，然后再自己吃。', '', '1'), ('960796', '93', 'shop/20150129094229269//20150129094229_oaNM.png', '吃完早饭，阿娇独自去了学校。她要一个人走近一个小时的山路，才能到达学校。', '', '1'), ('960804', '93', 'shop/20150129143329819//20150129143329_LbeR.png', '营养午餐。', '', '1'), ('960808', '93', 'shop/20150129150552256//20150129150552_mkUH.png', '中国扶贫基金会“捐一元”项目班级食物发放表。', '', '1'), ('960798', '93', 'shop/20150129094319741//20150129094319_qjdX.png', '2013年，中国扶贫基金会携手肯德基所属百胜餐饮集团中国事业部、联合国世界粮食计划署开展的“捐一元·献爱心·送营养”活动，为阿娇所在学校送来了蒸饭车、消毒柜、冰柜、操作台等标准“爱心厨房”设备。', '', '1'), ('960799', '93', 'shop/20150129094341630//20150129094341_KAxE.png', '“捐一元”活动为阿娇所在学校送来了蒸饭车、消毒柜、冰柜、操作台等标准“爱心厨房”设备，同时还为该校的所有学生每人每天提供一盒牛奶和一个卤鸡蛋的营养加餐，加上国家营养改善计划提供的免费午餐（菜谱为一荤一素一汤）。', '', '1'), ('960800', '93', 'shop/20150129094403734//20150129094403_OuHD.png', '有时候，幸福很复杂，各种欲望，各种需要，各种得不到的满足；还有些时候，幸福来得也很简单，或许仅仅就是拥有，哪怕是穷一些却完整温暖的家，亦或只是陌生人举手之劳的温暖。', '', '1'), ('960801', '93', 'shop/20150129094422365//20150129094422_wjbA.png', '新房小学食堂食材采购清单。', '', '1'), ('960802', '93', 'shop/20150129094521539//20150129094521_qCIp.png', '阿娇排队打饭。', '', '1'), ('960803', '93', 'shop/20150129094606523//20150129094606_yBTb.png', '一顿能完全吃饱的营养午餐，对于家庭贫困、缺少母爱的阿娇来说，亦能成为她童年的莫大幸福。', '', '1'), ('960807', '93', 'shop/20150129150502528//20150129150502_UMas.png', '而在这以前，阿娇没吃过牛奶和卤鸡蛋，甚至连听都没听说过。', '', '1'), ('960809', '93', 'shop/20150129150701064//20150129150701_zvpd.png', '阿娇中午不用再走近一个小时山路回家吃午饭了，下午上课、课间玩耍也更有精神。', '', '1'), ('960810', '93', 'shop/20150129150728065//20150129150728_Gtdx.png', '阿娇的小伙伴们一起吃营养加餐。', '', '1'), ('960811', '93', 'shop/20150129150858088//20150129150858_mOYQ.png', '小伙伴们的课间活动。', '', '1'), ('960812', '93', 'shop/20150129150923507//20150129150923_yUDz.png', '新房小学的大门口。', '', '1'), ('960813', '93', 'shop/20150129150945721//20150129150945_GGex.png', '说起自己的梦想，阿娇沉思了一会，抬起头望着山那边，低声地说：希望爸爸不再辛苦，姐姐的病能够好起来，妈妈也能回来看看姐姐和自己，看看这个家，真的很想妈妈……', '', '1'), ('960817', '136', 'shop/20150203134527871//20150203134527_Fllq.jpg', '', '', '1'), ('960816', '132', 'shop/20150203133856782//20150203133856_zBSb.jpg', '', '', '1'), ('960818', '136', 'shop/20150203134608374//20150203134608_Htgr.jpg', '', '', '1'), ('960820', '206', 'shop/20150203135959614//20150203135959_ucXq.jpg', '', '', '1');
COMMIT;

-- ----------------------------
--  Table structure for `gd_lottery`
-- ----------------------------
DROP TABLE IF EXISTS `gd_lottery`;
CREATE TABLE `gd_lottery` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `startTime` varchar(20) DEFAULT NULL,
  `endTime` varchar(20) DEFAULT NULL,
  `bannerUrl` varchar(1024) DEFAULT NULL,
  `bannerImg` varchar(1024) DEFAULT NULL,
  `memo` varchar(2048) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `ruleDesc` varchar(2048) DEFAULT NULL,
  `multipleBouns` int(1) DEFAULT NULL,
  `dayLimit` int(10) DEFAULT NULL,
  `totalLimit` int(10) DEFAULT NULL,
  `type` int(2) DEFAULT NULL,
  `odds` double DEFAULT NULL,
  `rand` int(10) DEFAULT '0',
  `totalCnt` int(10) unsigned DEFAULT NULL,
  `luckyCnt` int(10) DEFAULT NULL,
  `bonusImg` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `gd_lottery_idx_1` (`type`),
  KEY `gd_lottery_idx_2` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=76 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `gd_lottery`
