-- ----------------------------
--  Table structure for `gd_media`
-- ----------------------------
DROP TABLE IF EXISTS `gd_media`;
CREATE TABLE `gd_media` (
  `news_id` varchar(20) NOT NULL DEFAULT '0',
  `media_id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(500) DEFAULT NULL,
  `author` varchar(500) DEFAULT NULL,
  `img_url` varchar(1024) DEFAULT NULL,
  `content` text,
  `wx_media_id` varchar(500) DEFAULT NULL,
  `is_cover_pic` tinyint(1) DEFAULT '0' COMMENT '是否显示为封面',
  `source_url` varchar(500) DEFAULT NULL,
  `digest` varchar(2000) DEFAULT NULL,
  `media_type` varchar(20) DEFAULT NULL COMMENT '媒体类型',
  PRIMARY KEY (`news_id`,`media_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

