  `id` bigint(9) NOT NULL AUTO_INCREMENT COMMENT '权限标识',
  `name` varchar(128) NOT NULL COMMENT '权限名',
  `instance` varchar(64) DEFAULT NULL COMMENT '操作对象',
  `actions` varchar(128) DEFAULT NULL COMMENT '操作权限',
  `group` varchar(64) DEFAULT NULL COMMENT '权限组',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=1502 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='应用权限定义表\r\n';

